import React from 'react';
import './ProfileCard.css';
import { Card, CardHeader, CardContent } from '@material-ui/core';

export default function ProfileCard(data) {
  return (
    <Card className="custom-card">
      <CardHeader title={data.title} className="custom-card-header" />
      <CardContent className="custom-card00-content">
      <Grid container spacing={2}>
          <Grid item xs={2} className="custom-column">
            <Avatar className={classes.avatar} src={data.profileImage} alt="User Avatar" />
          </Grid>
          <Grid item xs={7}>
            <Grid container direction="column" spacing={2}>
              <Grid item className="name">
              <Typography variant="body1"  className={classes.name} component="h1">
                    {data.username}
              </Typography>
              </Grid>
              <Grid item>
                {/* Rating stars */}
              </Grid>
            </Grid>
          </Grid>
          <Grid item xs={3}>
            <Grid container direction="column" spacing={2}>
              <Grid item>
                {/* Phone icon */}
              </Grid>
              <Grid item>
                {/* Call icon */}
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </CardContent>
    </Card>
  );
}
